import {connect} from 'react-redux';
class Admin extends Component {
    state = {  }
    render() { 
        return (
            <div>
                <h3>{this.props.username}</h3>
            </div>
          );
    }
}

const mapStateToProps=(state)=>{
    return{
        username:state.username,
    }
}

